 the speed and accuracy of the classification.&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Reference database: Kaiju and Kraken2 use different reference databases for taxonomic classification. \nKaiju uses a database called &amp;amp;ldquo;NINJA&amp;amp;rdquo; (Non-redundant Improved and Normalized Just-in-time Annotations), \nwhich includes annotations for a wide variety of organisms.\nKraken2 uses a database called &amp;amp;ldquo;Minikraken,&amp;amp;rdquo; \nwhich includes annotations for a more limited set of organisms but is more comprehensive for those organisms.&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;"},"id":"1340","type":"panel.models.markup.HTML"},{"attributes":{},"id":"1267","type":"StringFormatter"},{"attributes":{},"id":"1323","type":"StringFormatter"},{"attributes":{},"id":"1361","type":"UnionRenderers"}],"root_ids":["1247"]},"title":"Bokeh Application","version":"2.4.3"}}
